from locust import HttpLocust, TaskSet, task
import json


class UserBehavior(TaskSet):

    uuid = 0 
    def incrementUuid(self):
        UserBehavior.uuid += 1
        return UserBehavior.uuid

    @task(1)    
    def putImage(self):
        uuid = self.incrementUuid()
        headers = {'content-type': 'application/json', "KEY": "YOURKEYVALUE"}
        self.client.put("/images",data= json.dumps({
            "Uuid": uuid,
            "ImageName" : "new02Raw.jpeg",
            "Base64EncodedSnapshot": ""             
    }), 
    headers=headers, 
    name = "Upload an Image")
 
 
class APILocust(HttpLocust):
    task_set = UserBehavior
    ## minimum wait a simulated user will wait between executing tasks 
    min_wait = 500
    max_wait = 15000
    host= "YourHost"

